import React from "react";
import { Typography } from "@material-ui/core";
import { Container, Row, Col, Button, ButtonGroup } from "react-bootstrap";
import Icon from "@mdi/react";
import { mdiChevronRight } from '@mdi/js'; 


export function TopBanner(){
    return(
        <Container fluid className="vh-100 align-content-center ">
            <Row className="justify-content-center ">
                <Col xs md="4" className='align-ietsm-center'>
                    <Typography variant="h2">Financia el sueño de tu empresa</Typography>
                    <Typography>Nuestro modelo de riesgos evalúa en segundos una operación, lo que nos permite financiar en el mismo día.  
                    </Typography>
                    
                    <ButtonGroup className="me-2" aria-label="Second group" size="lg">
                        <Button>Empieza a financiarte</Button> 
                        <Button> 
                            <Icon path={mdiChevronRight}
                            size={1}
                            horizontal
                            vertical
                            rotate={180}
                            color="white"/>
                            </Button> 
                    </ButtonGroup>
                </Col>
                <Col lg="5">
                </Col>
            </Row>
        </Container>
    )
}
